import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Goals from "./Goals";
import GoalDetails from "./GoalDetails";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/goals" element={<Goals />} />
        <Route path="/goal/:id" element={<GoalDetails />} />
      </Routes>
    </Router>
  );
}

export default App;
